import "./index.css";
import logo from "./images/logo2.svg";

function Footer() {
  return (
    <div className="Footer">
      <a href="#">
        <img src={logo} height="130px" width="94px" />
      </a>
      <p>fGITL</p>
    </div>
  );
}

export default Footer;
